import React from 'react';
import data from '../data';


export default function CategoryDetail(match) {
    const { types } = data;
    console.log({ types })
    console.log({ match })
    return (
        <div>
            {types.map((type) => (
                (match.params.type_name) === (type.type_name) ? (
                    <div>
                        {type.type_name}
                    </div>)
                    :
                    (null)
                )

            )}
        </div>
    )
}
